INSERT INTO genres (name, country, description,imglink) VALUES ("Afghani-Pop", 16, "Afghani Pop is a genre of music that originated in Afghanistan. It is a combination of traditional Afghan music and Western pop music. It is one of the most popular music genres in Afghanistan.","https://cdn.discordapp.com/attachments/1008571040097632317/1041082981944664185/whimsyandwoe_afghani_pop_cover_ece62a67-bb6d-40d6-bfbe-c8d6fa3daf37.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("US-Rockabilly", 1, "Rockabilly is a genre of music that was popular in the 1950s and 1960s. It is a fusion of Rock and Roll and Country music. It is characterized by a strong back beat (typically provided by a double bass or electric bass guitar) and by twangy electric guitar often played through a Fender amp, sometimes using a pedal steel guitar, and sometimes using the Hawaiian guitar. The beat is often accentuated by the handclapping. ","https://cdn.discordapp.com/attachments/1008571040097632317/1041083308815167589/whimsyandwoe_us_rockabilly_hillbilly_redneck_music_album_cover_d37c48d4-e020-4338-80bd-4fe9fd94a935.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Metal",11,"Brazilian metal is a musical movement that originated in the 1980s. Though not as large or well known as the North American or European metal movements, it bridged the gap of the mid-1980s and the death metal scene later in the decade and the first-wave of black metal. Although some bands have become mainstream, the scene is an underground icon. It is in some ways more extreme than even German metal, and is often considered to be the most extreme metal scene in the world. ","https://cdn.discordapp.com/attachments/1008571040097632317/1041074821821366282/whimsyandwoe_brazillian_metal_cover_ba6f47ab-8e7a-4bbe-aafa-390735f23419.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Tech-House",11,"Brazilian Tech House is a genre of electronic music that originated in Brazil. It is a fusion of Brazilian House and Tech House. It combines elements such as 'rugged basslines' from the earlier rio scene, and 'steely beats', with the harmonies and grooves of progressive house.","https://cdn.discordapp.com/attachments/1008571040097632317/1041079009938784277/whimsyandwoe_brazillian_house_techno_tech_cover_d6fe7a15-68b1-49d9-b61d-b6d4b6f77133.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Punk",11,"Punk rock and hardcore punk in Brazil originated in the late 1970s, influenced by bands such as Sex Pistols, The Clash, Stiff Little Fingers and The Ramones. The first known Brazilian punk rock band was Restos de Nada ('remains of nothing'), which appeared in mid-1978 and set the stage for the emergence of many other bands that formed the Brazilian punk scene.","https://cdn.discordapp.com/attachments/1008571040097632317/1041076246710325258/whimsyandwoe_brazillian_punk_cover_675efe64-d439-49e5-9d24-a5aa7b3f09ce.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Drum-n-Bass",11,"Drum and bass is a genre of electronic music characterised by fast breakbeats (typically 165-185 beats per minute) with heavy bass and sub-bass lines, sampled sources, and synthesizers. The music grew out of breakbeat hardcore (also called simply hardcore) in the early 1990s, and was initially influenced by the styles of funk, soul, jazz, and reggae. The style is now commonly referred to simply as drum and bass, or D&B.","https://cdn.discordapp.com/attachments/1008571040097632317/1041078301982199839/whimsyandwoe_brazillian_drum_n_bass_dnb_cover_7591ca6b-6061-4556-b5f6-4b2c9fce398f.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Reggae",11,"Reggae is a music genre first developed in Jamaica in the late 1960s. While sometimes used in a broad sense to refer to most types of popular Jamaican dance music, the term reggae more properly denotes a particular music style that was strongly influenced by traditional mento as well as American jazz and rhythm and blues and emerged in the late 1960s as a political, religious and dance-oriented genre.","https://cdn.discordapp.com/attachments/1008571040097632317/1041074763956768788/whimsyandwoe_brazillian_reggae_cover_261edf42-3c5e-41ae-8797-1ca1f4fcbbd2.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Brazillian-Blues",11,"The blues as a musical genre, entered Brazilian musical landscapes at the tail end of Brazil‚Äôs military dictatorship (1964-1985), overlapping the Reagan/Thatcher Era. However, it never gained a major entry into Brazilian musical mainstream until the late 1980's/early 1990's. When it did, it was a hybrid of the American blues and the Brazilian samba - 'O Blues Nacional'","https://cdn.discordapp.com/attachments/1008571040097632317/1041072842294431786/whimsyandwoe_brazillian_blues_cover_51025abd-d916-4538-a18e-265f2b700040.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Hyperpop",5,"Hyperpop is an emerging genre of music that first broke onto the scene in the UK in the 2010's. It is characterized by a maximalist or exaggerated take on popular music, and artists within the genre typically integrate pop and avant-garde sensibilities while drawing on themes commonly found in electronic, hip hop, and dance music. The german scene is still nascent, but is growing quickly, with artists such as Haiyti, Hello Hannes, and Icy leading the way.","https://cdn.discordapp.com/attachments/1008571040097632317/1041081580594139266/whimsyandwoe_german_hyperpop_cute_cover_6dda4686-acc6-432a-9b7d-a23cd994f62f.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Pagan-Metal",5,"German pagan metal is a distinct subscene of pagan metal. Unlike their nordic cousins, the german scene tends to draw less from folk music and instruments and strays more into the heavier side of metal, with bands such and Helgrindur and their fast, heavy sound defining the scene.","https://cdn.discordapp.com/attachments/1008571040097632317/1041079083771117589/whimsyandwoe_german_pagan_metal_2ef18aba-6de7-4aa3-ba55-eabd06a99cbe.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Ska",5,"Ska is a music genre that originated in Jamaica in the late 1950s and was the precursor to rocksteady and reggae. Ska combined elements of Caribbean mento and calypso with American jazz and rhythm and blues. It is characterized by a walking bass line accented with rhythms on the off-beat. Ska developed in Jamaica in the 1960s when Prince Buster, Clement 'Coxsone' Dodd, and others introduced the Jamaican ska sound to the UK.","https://cdn.discordapp.com/attachments/989739840067207219/1041085795861266483/skapunkgerman_german_ska_album_cover_56906cf8-c081-4898-8a0c-2ccac2fae5f7.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Cloud-Rap",5,"Cloud rap is a subgenre of Southern rap and trap music that has several sonic characteristics of lo-fi in its hazy, dreamlike and relaxed sound. It is a rising force in the wider European music scene. Although it is relatively little known compared to the US scene, it has formed a very distinctive sound and culture in Germany.","https://cdn.discordapp.com/attachments/989739840067207219/1041087926093754458/skapunkgerman_german_cloud_rap_album_cover_0cbb1b7d-c0e9-4dcb-956b-da4a2a915c4b.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Country",5,"Now home to a vibrant and active subculture that includes local artists, music festivals, and even theme parks, Germany has embraced country music like nowhere else.", "https://cdn.discordapp.com/attachments/989739840067207219/1041089194635829298/skapunkgerman_german_country_cover_fc3d78df-fa94-49bb-9241-7a068feb186b.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("German-Jazz",5,"Jazz has been in Germany since the beginning, first emerging in 1927. Over time, elements of jazz were increasingly integrated with other styles such as hip-hop, later drum 'n' bass and others, most prominently by the internationally successful duo Tab Two. These new styles of fusion were assessed as Acid Jazz or as Nu jazz. Today jazz elements can be found in a great variety of musical styles, such as German Hip-Hop, House, Drum 'n' Bass, dance music, and many others.","https://cdn.discordapp.com/attachments/989739840067207219/1041091755723997228/skapunkgerman_german_jazz_album_cover_2c19f3e0-2ef3-4b64-ad29-45d557914c95.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Soul",15,"Soul music is a popular music genre that originated in the United States in the 1950s and early 1960s. It combines elements of African-American gospel music, rhythm and blues and jazz. Soul music became popular for dancing and listening in the United States, where record labels such as Motown, Atlantic and Stax were influential during the Civil Rights Movement. Soul also became popular around the world, directly influencing rock music and the music of Africa.","https://cdn.discordapp.com/attachments/989739840067207219/1041093870424961074/skapunkgerman_japanese_soul_cover_51fd0547-5133-48a9-9c68-99d653875659.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Indie-Folk",15,"Indie folk is a genre of folk music that combines elements of indie rock and other genres. It is a broad genre, with many subgenres, including folk punk, folktronica, and folk pop. The genre emerged in the 1990s as a reaction against the popularity of grunge and alternative rock. It is often associated with the anti-folk movement, which began in the 1980s.","https://cdn.discordapp.com/attachments/989739840067207219/1041094403621670922/skapunkgerman_japanese_indie_folk_cover_547eb1c0-f04d-43a6-ac41-7b4274958a1c.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Garage-Rock",15,"Japanese Garage Rock draws from multiple genres of American music, including rock and roll, surf, rockabilly, doo-wop, punk rock and psychobilly. It is sometimes said to deconstruct rock 'n' roll into punk music by using distortion and noise and screaming.","https://cdn.discordapp.com/attachments/989739840067207219/1041096264776953906/skapunkgerman_japanese_garage_rock_cover_35a879d2-d448-499b-b87b-91bcbeb78907.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Classic-Piano",15,"Japanese classical piano draws substantial inspiration from both eastern and western musical canon, fusing the likes of Mozart with T≈çru Takemitsu.","https://cdn.discordapp.com/attachments/989739840067207219/1041098050833240094/skapunkgerman_japanese_classical_piano_cover_bf8e980f-ed65-493e-b7b4-20ffe4ce3e65.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Power-Metal",15,"It can be bizarre. It can also be off-putting. But it‚Äôs an entirely new realm of the sub-genre that can afford some great new bands and masterpieces to listeners. The power metal scene has really blossomed since the arrival of the 'X Japan' festival in the ‚Äô80s, and since then it‚Äôs been taken to new heights and limits.","https://cdn.discordapp.com/attachments/989739840067207219/1041099451844022303/skapunkgerman_japanese_power_metal_cover_278abde3-f47c-40a3-88b8-c1f5fb7bf2ca.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Japanese-Celtic",15,"An unlikely combination, there are a surprising number of Japanese Celtic bands","https://cdn.discordapp.com/attachments/989739840067207219/1041100462318960660/skapunkgerman_japanese_celtic_album_cover_92ef4d8e-b69f-4142-af87-bc1290cc84bb.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indonesian-Bamboo",17,"Indonesian Bamboo music is also known as Angklung, is a traditional music style found in Indonesia, and is a merry upbeat music played using bamboo pipes struck with hammers, similar to the european glockenspiel or tubular bells.","https://cdn.discordapp.com/attachments/1008571078211280957/1041111281714872352/javan-marvin_indonesian_bamboo_cover_97a41374-67f1-4aa0-ab6e-9f780f3540b9.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indorock",17,"Indorock, or indonesian rock, is a musical genre that originated in the 1950s in the Netherlands. It is a fusion of Indonesian and Western music, with roots in Kroncong (traditional Portuguese-Indonesian fusion music). The genre was invented by Indo repatriates in the Netherlands after Indonesian independence on August 17, 1945. The guitar was imported to the archipelago of the East Indies by Portuguese explorers in the 16th century. The traditional Portuguese song styles, saudade and fado, played with guitar accompaniment, later became kroncong music.","https://cdn.discordapp.com/attachments/1008571078211280957/1041112423484104864/javan-marvin_indonesian_indorock_cover_1f5bbc36-a9e3-413c-8db7-42df4223f680.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indonesian-Deathcore",17,"Indonesian Deathcore certainly is a thing. Sorry it's hard to write so many descriptions ü§ò.","https://cdn.discordapp.com/attachments/1008571078211280957/1041113773022392400/javan-marvin_indonesian_indorock_rock_guitar_cover_30671639-ebc0-4a44-bf07-63959de931df.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indonesian-Emo-Rap",17,"Emo rap is a fusion genre of hip hop and emo music. Originating in the SoundCloud rap scene in the mid-2010s, the genre fuses characteristics of hip hop music, such as beats and rapping, with the lyrical themes, instrumentals, and vocals commonly found in emo music","https://cdn.discordapp.com/attachments/1008571078211280957/1041114719588724847/javan-marvin_indonesian_emo_rap_cover_cef2aeae-1598-4696-9b7a-710a48af5073.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indonesian-City-Pop",17,"Indonesian City Pop is an offshoot of the more popular Japanese version. City pop („Ç∑„ÉÜ„Ç£„Éª„Éù„ÉÉ„Éó, shiti poppu) is a loosely defined form of Japanese pop music that emerged in the late 1970s and peaked in the 1980s. It was originally termed as an offshoot of Japan's Western-influenced 'new music', but came to include a wide range of styles ‚Äì including AOR, soft rock, R&B, funk, and boogie ‚Äì that were associated with the country's nascent economic boom and leisure class. It was also identified with new technologies such as the Walkman, cars with built-in cassette decks and FM stereos, and various electronic musical instruments.","https://cdn.discordapp.com/attachments/1008571078211280957/1041117235311284396/javan-marvin_indonesian_city_pop_metropolitan_cover_43177196-5d2a-4e66-b516-3ce3ef5a0db6.png");
INSERT INTO genres (name, country, description,imglink) VALUES ("Indonesian-R-n-B",17,"Indonesian R&B is a genre of music that originated in the United States in the 1940s and 1950s. It is a fusion of African American musical styles such as blues, jazz, soul, funk, and gospel, with influences from American pop and rock music.","https://cdn.discordapp.com/attachments/1008571078211280957/1041117274230247525/javan-marvin_indonesian_rb_cover_56cb17ce-4fef-4909-970c-0adc7d35e756.png");
